  02> EVANS, Sonya Anne
  b 20.09.1972
  Sonya b. at Sydney, NSW. Address: 1/17 May Street, Eastwood 2122, NSW, Australia.
  Sonya was educated at Weston Primary School, Weston, Canberra, ACT; Adamstown Heights Primary
  School, Newcastle, NSW; West Pennant Hills Primary School, Sydney, NSW; and Carlingford High
  School, Carlingford, NSW. She joined Westpac Bank before transferring to Barclays Bank and
  subsequently to transferring to Citicorp. She works in their International and Treasury
  Services.
  03> EVANS, Tracy Leanne
  b 10.07.1974
  Tracy b, at Sydney, NSW. Address: 1/17 May Street, Eastwood 2122, NSW, Australia,
  Tracy was educated at Adamstown Heights Primary School, Newcastle, NSW; West Pennant Hills
  Primary School, Sydney, NSW; and Carlingford High School, Carlingford, NSW. She joined a real
  estate agency, advancing to Marketing Manager at Eastwood Shopping Centre, Sydney. She has
  studied through Meadowbank TAFE in Sydney and completed Property Agency and Marketing courses.
  62> MACLEAN, John David Bruce
  b 04.04.1949
  John b. at Wellington. Address: 64 Orwell Street, Blacktown 2148, NSW, Australia.
  02> MACLEAN, Peter Alloway m on 12.05. 1967 to (2) THORN, Mary Eleanor
  b 11.04.1920
  b 23.03.1917
  Peter m. at Canberra, ACT, Australia. Mary, dlo Alfred Thorn and Elsie Millner Davidson, b. at
  Angaston, South Australia. Address: 6 Riley Street, Narooma, NSW 2546, Australia.
  Peter was educated at Wanganui Collegiate School and gained a BSc at London University. He joined the
  mercantile marine and was a Lieutenant in the Royal Australian Navy during WW2. After the war he was
  Deputy Director of Lighthouses and Navigation, South Australia, and a senior computer programmer with
  the Australian Defence Department in Canberra. He retired from the Department of Defence in 1980 and
  started an accountancy practice in Narooma, NSW, finally retiring in 1997. He is involved in the Life
  Education Programme and Rotary.
  Mary was educated at Angaston Girls' Grammar School, Presbyterian Girls' College in Adelaide, Chartres
  Business College in Adelaide and as a part-time external student at New England University in NSW. She
  saw war service in 1943-45 in Australia and New Guinea as a Welfare Officer in the Australian Women's
  Army. She did voluntary work in Adelaide, Canberra and Narooma involving community organisations and
  stood for the local council in 1983. In 1992 she was awarded New South Wales State Citizen of the Year
  for general community work. Her other interests include music, painting and writing.
  Mary has children Richard, Marguerite, Spencer, Jeanette and Anne from a previous marriage and her
  grandchildren are Kate, Anna, Patricia, Andrew, Jessica, Melissa, Cathryn, Belinda, Paul, Ian, Benita,
  Matthew and Tania.
  03> MACLEAN, Christopher David
  b 08.09.1923 d 18.09.1944
  David b. at Gisborne and killed in action in the south-west Pacific. He was educated at
  Wanganui Collegiate School and Auckland University where he was studying for an
  Engineering degree. He left to join the RNZAF and became a Pilot Officer.
